import React from 'react'
import Header from './Header'
import Features from './Features'
import Commitments from './Commitments'
import Card from './Card'

function Home() {
  return (
    <div>
      <Header />
      <Features />
      <Commitments />
      <Card />
      
    </div>
  )
}

export default Home;
